    const postsArray = useSelector(
        state => state.tuits
    );

    return (
        <ul className="list-group">
            {
                postsArray.map(tuit =>
                    <TuitItem
                        key={tuit._id}
                        tuit={tuit}
                    />
                )
            }
        </ul>
    );
};

